import React from 'react';
import { Box, Button, Container, Typography, Grid, Paper } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/authContext';

const HeroSection = () => {
  const navigate = useNavigate();
  const { user } = useAuth();

  return (
    <Box
      sx={{
        py: 8,
        bgcolor: 'var(--bg-secondary)', // Use secondary background for contrast
        color: 'var(--text-primary)',
        borderRadius: 1,
      }}
    >
      <Container maxWidth="md" sx={{ textAlign: 'center' }}>
        <Typography variant="h2" gutterBottom sx={{ fontWeight: 700 }}>
          Your Local <span style={{ color: 'var(--accent-primary)' }}>Laundry</span> Service
        </Typography>
        <Typography variant="h6" color="var(--text-secondary)" paragraph>
          Get premium laundry and dry cleaning delivered right to your doorstep.
        </Typography>
        <Box sx={{ mt: 4 }}>
          {user ? (
            <>
              <Button
                variant="contained"
                size="large"
                sx={{ mr: 2, backgroundColor: 'var(--accent-primary)', '&:hover': { backgroundColor: 'var(--accent-secondary)' } }}
                onClick={() => navigate('/order/new')}
              >
                Place New Order
              </Button>
              <Button
                variant="outlined"
                size="large"
                sx={{ color: 'var(--accent-primary)', borderColor: 'var(--accent-primary)' }}
                onClick={() => navigate('/track')}
              >
                Track Your Order
              </Button>
            </>
          ) : (
            <>
              <Button
                variant="contained"
                size="large"
                sx={{ mr: 2, backgroundColor: 'var(--accent-primary)', '&:hover': { backgroundColor: 'var(--accent-secondary)' } }}
                onClick={() => navigate('/login')}
              >
                Login
              </Button>
              <Button
                variant="outlined"
                size="large"
                sx={{ color: 'var(--accent-primary)', borderColor: 'var(--accent-primary)' }}
                onClick={() => navigate('/register')}
              >
                Register
              </Button>
            </>
          )}
        </Box>
      </Container>
    </Box>
  );
};
 <Grid item xs={12} md={6}>
          <Box
            component="img"
            src="/images/laundry_illustration.jpg" // âœ… Image source updated to use .jpg
            alt="Laundry service illustration"
            sx={{
              maxWidth: '100%',
              height: 'auto',
            }}
          />
        </Grid>
const FeatureCard = ({ title, description }) => (
  <Grid item xs={12} sm={6} md={4}>
    <Paper
      elevation={3}
      sx={{
        p: 3,
        textAlign: 'center',
        bgcolor: 'var(--bg-primary)',
        color: 'var(--text-primary)',
        border: '1px solid var(--border-color)'
      }}
    >
      <Typography variant="h6" gutterBottom sx={{ fontWeight: 600 }}>
        {title}
      </Typography>
      <Typography variant="body2" color="var(--text-secondary)">
        {description}
      </Typography>
    </Paper>
  </Grid>
);

const FeaturesSection = () => {
  const features = [
    { title: 'Convenient Pickup & Delivery', description: 'Schedule your laundry online and weâ€™ll handle the rest.' },
    { title: 'Professional Cleaning', description: 'Our expert team ensures your clothes are cleaned to the highest standards.' },
    { title: 'Affordable Pricing', description: 'Get premium laundry services without breaking the bank.' },
  ];

  return (
    <Container sx={{ py: 6 }}>
      <Typography variant="h5" align="center" gutterBottom sx={{ fontWeight: 600 }}>
        Why Choose Us?
      </Typography>
      <Grid container spacing={3} sx={{ mt: 2 }}>
        {features.map((feature, index) => (
          <FeatureCard key={index} title={feature.title} description={feature.description} />
        ))}
        
      </Grid>
    </Container>
  );
};

const Home = () => (
  <Box>
    <HeroSection />
    <FeaturesSection />
    {/* You could add more sections here like "How it works" or testimonials */}
  </Box>
);

export default Home;
